create table t_customer
(
    id             bigint auto_increment
        primary key,
    phone          varchar(64)                              null comment '手机号',
    name           varchar(64)                              not null comment '用户名',
    is_delete      tinyint        default 0                 not null comment '是否删除',
    member_type    tinyint        default 0                 not null comment '会员类型',
    created_at     datetime       default CURRENT_TIMESTAMP not null comment '创建时间',
    updated_at     datetime       default CURRENT_TIMESTAMP not null comment '更新时间',
    consume_count  bigint         default 0                 not null comment '消费次数',
    consume_amount decimal(10, 2) default 0.00              not null comment '累计消费金额',
    last_visit_at  datetime       default CURRENT_TIMESTAMP not null comment '最近到店时间'
)
    charset = utf8mb4;

